/*Table structure for table `shop_product_detail` */

DROP TABLE IF EXISTS `shop_product_detail`;

CREATE TABLE `shop_product_detail` (
  `id` int(11) NOT NULL AUTO_INCREMENT,
  `product_id` int(11) DEFAULT NULL,
  `supplier_id` int(11) DEFAULT NULL,
  `stock_status_id` tinyint(1) DEFAULT NULL,
  `sku` varchar(64) DEFAULT NULL,
  `color` varchar(64) DEFAULT NULL,
  `size` varchar(30) DEFAULT NULL,
  `price_in` decimal(15,4) DEFAULT '0.0000',
  `price` decimal(15,4) DEFAULT '0.0000',
  `new_status` decimal(3,2) DEFAULT '1.00',
  `stock_in_date` datetime DEFAULT NULL,
  `stock_in_type` tinyint(1) DEFAULT '0',
  `stock_in_note` varchar(500) DEFAULT NULL,
  `stock_out_date` datetime DEFAULT NULL,
  `stock_out_type` tinyint(1) DEFAULT '0',
  `stock_out_note` varchar(500) DEFAULT NULL,
  `debt_status` tinyint(1) DEFAULT '0',
  `created_at` datetime DEFAULT NULL,
  `updated_at` datetime DEFAULT NULL,
  PRIMARY KEY (`id`),
  KEY `product_fk` (`product_id`),
  KEY `supplier_fk` (`supplier_id`),
  CONSTRAINT `product_fk` FOREIGN KEY (`product_id`) REFERENCES `shop_product` (`id`),
  CONSTRAINT `supplier_fk` FOREIGN KEY (`supplier_id`) REFERENCES `shop_supplier` (`id`)
) ENGINE=InnoDB AUTO_INCREMENT=43 DEFAULT CHARSET=utf8;

