/*Table structure for table `sys_street` */

DROP TABLE IF EXISTS `sys_street`;

CREATE TABLE `sys_street` (
  `id` int(11) NOT NULL AUTO_INCREMENT,
  `city_id` int(11) NOT NULL,
  `district_id` int(11) NOT NULL,
  `name` varchar(255) NOT NULL,
  `pre` varchar(32) DEFAULT NULL,
  `geometry` text,
  `center` varchar(32) DEFAULT NULL,
  `order` int(11) DEFAULT NULL,
  `status` tinyint(1) DEFAULT '1',
  `slug` varchar(255) DEFAULT NULL,
  PRIMARY KEY (`id`),
  KEY `street:district_id&district_id` (`district_id`) USING BTREE,
  CONSTRAINT `sys_street_ibfk_1` FOREIGN KEY (`district_id`) REFERENCES `sys_district` (`id`)
