/*Table structure for table `sys_ward` */

DROP TABLE IF EXISTS `sys_ward`;

CREATE TABLE `sys_ward` (
  `id` int(11) NOT NULL AUTO_INCREMENT,
  `city_id` int(11) NOT NULL,
  `district_id` int(11) NOT NULL,
  `name` varchar(32) NOT NULL,
  `slug` varchar(128) DEFAULT NULL,
  `geometry` text,
  `center` varchar(32) DEFAULT NULL,
  `color` varchar(32) DEFAULT NULL,
  `bounding_box` varchar(255) DEFAULT NULL,
  `pre` varchar(32) DEFAULT NULL,
  `order` int(11) DEFAULT NULL,
  `status` tinyint(1) NOT NULL DEFAULT '1',
  PRIMARY KEY (`id`),
  KEY `ward:district_id&district:id` (`district_id`) USING BTREE,
  CONSTRAINT `sys_ward_ibfk_1` FOREIGN KEY (`district_id`) REFERENCES `sys_district` (`id`)
) ENGINE=InnoDB AUTO_INCREMENT=11166 DEFAULT CHARSET=utf8;

